import React, { Component } from 'react';
import {Map, InfoWindow, Marker, GoogleApiWrapper} from 'google-maps-react';
import axios from "axios";
import NavbarMaps from '../../components/common/navbarMaps';
import './maps.css'

const mapStyles = {
    top: '0',
    buttom: '0',
    width: 'auto',
    height: 'auto',
    left: '300px',
};

export class MapContainer extends Component {
    componentDidMount() {
        axios.get(`http://localhost:4000/getRankProvince`)
            .then(res => {
                const province = res.data;
                this.setState({ 
                    province 
                });
            })
    }

    state = {
        showingInfoWindow: false,
        activeMarker: {},
        selectedPlace: {},
        placename: '',
        // placename_fromButton: '',
    };

    onMarkerClick = (props, marker, e) =>
        this.setState({
            selectedPlace: props,
            activeMarker: marker,
            showingInfoWindow: true,
            placename: props.name,
        });

    onMapClicked = (props) => {
        if (this.state.showingInfoWindow) {
            this.setState({
                showingInfoWindow: false,
                activeMarker: null
            })
        }
    };

    render() {
        return (  
            <div class="noscroll">
                <NavbarMaps />
                <div class="sidenav">
                    <div class="sidePlaceName">น่าน</div>
                    <div class="sideClickedPlace">{this.state.placename}</div>
                    {this.state.placename === "หาดสุรินทร์"? 
                        <>
                            <a href="https://pantip.com/topic/39530285">
                                <div class="sideLinkBox">
                                    <div class="sideLinkTitle">[CR] เที่ยวไปกินไป by laser @ ภูเก็ต 2</div>
                                    <div class="sideLinkDesc">Read : 256</div>
                                </div>  
                            </a> 
                        </>
                    :   (this.state.placename === "หาดกะรน"? 
                            <>
                                <a href="https://pantip.com/topic/40248096">
                                    <div class="sideLinkBox">
                                        <div class="sideLinkTitle">[SR] … รีวิว โรงแรม เลอเมอริเดียน ภูเก็ตบีชรีสอร์ท Le Meridien Phuket Beach Resort กับแม่ประนอม จ้า</div>
