                                        <div class="sideLinkDesc">Read : 185</div>
                                    </div>  
                                </a>

                            {/* try scroll in sidebar */}
                            <a href="https://pantip.com/topic/40155571">
                                    <div class="sideLinkBox">
                                        <div class="sideLinkTitle">[CR] +++ ภูเก็ต ที่แตกต่าง +++</div>
                                        <div class="sideLinkDesc">Read : 256</div>
                                    </div>  
                                </a> 
                                <a href="https://pantip.com/topic/40187628">
                                    <div class="sideLinkBox">
                                        <div class="sideLinkTitle">[SR] เที่ยวภูเก็ต คนเดียว 5วัน4คืน (กันยายน2563)</div>
                                        <div class="sideLinkDesc">Read : 213</div>
                                    </div>  
                                </a> 
                                <a href="https://pantip.com/topic/40233180">
                                    <div class="sideLinkBox">
                                        <div class="sideLinkTitle">[CR] เพื่อนเก่า..เราเที่ยวกัน : 4 วัน 4 จังหวัด</div>
                                        <div class="sideLinkDesc">Read : 213</div>
                                    </div>  
                                </a>
                                <a href="https://pantip.com/topic/40236959">
                                    <div class="sideLinkBox">
                                        <div class="sideLinkTitle">[CR] เราไปหาฝน ณ เสม็ดนางชีบูทีค พังงา & SALA ภูเก็ต</div>
                                        <div class="sideLinkDesc">Read : 213</div>
                                    </div>  
                                </a>
                                <a href="https://pantip.com/topic/40054604">
                                    <div class="sideLinkBox">
                                        <div class="sideLinkTitle">[CR] รีวิว..เที่ยวภูเก็ตหลังโควิด มันส์ดีมาก</div>
                                        <div class="sideLinkDesc">Read : 185</div>
                                    </div>  
                                </a>
                                {/* END of test  */}
                            </>
                    :  <></>
                    )))}
                </div>

                <Map google={this.props.google}
                    style={mapStyles}
                    zoom={8}
                    initialCenter={{lat: 18.7756318, lng: 100.7730417}}>
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'อำเภอปัว'}
                        position={{lat: 19.1873229, lng: 101.0259275}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'ถนนคนเดินเมืองน่าน'}
                        position={{lat: 18.7749045, lng: 100.771892}} />
                    <Marker
                        onClick={this.onMarkerClick}
