                        onClick={this.onMarkerClick}
                        name={'หมู่บ้านนานกเค้า'}
                        position={{lat: 18.7756318, lng: 100.7730417}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'แม่นํ้าน่าน'}
                        position={{lat: 18.754786300000006, lng: 100.7440808}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'ดอยภูแว จ.น่าน'}
                        position={{lat: 19.3858333, lng: 101.1166667}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'ดอยเสมอดาว'}
                        position={{lat: 18.376116600000003, lng: 100.8273546}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'เขตตำบลดู่ใต้ อ.เมือง จ.น่าน'}
                        position={{lat: 18.7294192, lng: 100.73797059999998}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'ตำบลม่วงตึ๊ด อำเภอภูเพียง จังหวัดน่าน'}
                        position={{lat: 18.7517142, lng: 100.8084675}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'สะปัน'}
                        position={{lat: 19.1905747, lng: 101.1988426}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'วัดต้นแหลง'}
                        position={{lat: 19.1888205, lng: 100.9063722}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'วัดภูเก็ต'}
                        position={{lat: 19.1653656, lng: 100.93413}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'วัดพระธาตุเบ็งสกัด'}
                        position={{lat: 19.1783647, lng: 100.9174393}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'วัดร้องแง'}
                        position={{lat: 19.175690600000006, lng: 100.9358111}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'บ่อเกลือ'}
                        position={{lat: 19.0825056, lng: 101.207047}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'วัดสะปัน'}
                        position={{lat: 19.1888537, lng: 101.1997307}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'น้ำตกสะปัน'}
                        position={{lat: 19.1905747, lng: 101.1988426}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'เฮือนภูคา'}
                        position={{lat: 18.7809504, lng: 100.7797756}} />
                    <Marker
                        onClick={this.onMarkerClick}
                        name={'นาน้อย'}
                        position={{lat: 18.2657001, lng: 100.7548851}} />


                    <InfoWindow
                        marker={this.state.activeMarker}
                        visible={this.state.showingInfoWindow}>
                        <p>{this.state.selectedPlace.name}</p>
                    </InfoWindow>
                </Map>
            </div>
        );
    }
}

export default GoogleApiWrapper({
    apiKey: ('AIzaSyCoOZKGkK9Ili7RHCrB0dVNqhy6_e1yKyM')
